import BrainstormThreadButton from "./BrainstormThreadButton"

const BrainstormThreadsTray = ({
	brainstormThreads,
	setBrainstormThreads,
	selectedBrainstormThread,
	setSelectedBrainstormThread,
}) => {
	return (
		<div className='mt-10 self-start grow overflow-y-scroll w-full'>
			{brainstormThreads.map((thread, index) => {
				return (
					<BrainstormThreadButton
						key={index}
						thread={thread}
						brainstormThreads={brainstormThreads}
						setBrainstormThreads={setBrainstormThreads}
						selectedBrainstormThread={selectedBrainstormThread}
						setSelectedBrainstormThread={setSelectedBrainstormThread}
					/>
				)
			})}
		</div>
	)
}

export default BrainstormThreadsTray
